import React from 'react'
import InstagramIcon from '@material-ui/icons/Instagram';
import YouTubeIcon from '@material-ui/icons/YouTube';
function Footer() {
    return (
        <>
            <footer>
                <p>2021 All rights are reserved</p>
                 <InstagramIcon/>
                 <YouTubeIcon/>
            </footer>
        </>
    )
}

export default Footer
